#define MAX 10000010
/***********************************THE GRASS IS ALWAYS GREENER ON THE OTHER SIDE***********************************/

LL dp[MAX];

class ModModMod {
public:
	long long findSum(vector <int> m, int R) {
		LL ret = 0, i;
		clr(dp, -1);
		LL mn = *min_element(all(m));
		for(i = 1; i < mn; i++)
            ret += i, dp[i] = i;
		for(i = mn; i <= R; i++)
        {
            int cur = i, j = 0;
            while(dp[cur] == -1 && j < SZ(m))
                cur %= m[j++];
            if(dp[cur] != -1)
                dp[i] = dp[cur];
            else
                dp[i] = cur;
            ret += dp[i];
        }
        return ret;
	}
};


